import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css";

import { AppProvider } from "./context/AppContext";
import { Navigate } from "react-router-dom";

import Home from "./pages/Home";
import Summary from "./pages/Login";
import Game from "./pages/Registration";

export default function App() {
  return (
    <AppProvider>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/game" element={<Game />} />
          <Route path="/summary" element={<Summary />} />
          <Route path="/shared" element={<Navigate to="/" keepParams />} />
          <Route path="/regame" element={<Navigate to="/game" keepParams />} />
          <Route path="/*" element={<Navigate to="/" keepParams />} />
        </Routes>
      </BrowserRouter>
    </AppProvider>
  );
}
